import React from "react";

const Contact = () => {
  return (
    <div className="section">
      <h2>Contact Me</h2>
      <p>Email: shastry918@gmail.com</p>
      <p>Phone: 8459839776</p>
      <p>LinkedIn: www.linkedin.com/in/shreya-shastry-a92b44232</p>
    </div>
  );
};

export default Contact;
